import React, { useState, useEffect } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';

import { DataGrid } from '@material-ui/data-grid';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Button from '@material-ui/core/Button';
import EditIcon from '@material-ui/icons/Edit';

import Title from './Title';

function preventDefault(event) {
    event.preventDefault();
  }

  const useStyles = makeStyles((theme) => ({
    seeMore: {
      marginTop: theme.spacing(3),
    },
  }));

  // Hooks API data fetching
  export default function MyComponent() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);
    const columns = [
        { field: 'id', headerName: 'ID', width: 90 },
        {
          field: 'clientName',
          headerName: 'Client Name',
          width: 200,
        },
        {
          field: 'clientEmail',
          headerName: 'Email',
          width: 130,
        },
        {
          field: 'clientWorkPhone',
          headerName: 'Phone',
          type: 'number',
          width: 130,
        },
        {
          field: 'clientIndustry',
          headerName: 'Industry',
          width: 130,
        },
        {
          field: 'clientPocName',
          headerName: 'Point of Contact',
          width: 180,
        },
        {
          field: 'clientWebsite',
          headerName: 'Website',
          width: 130,
        },
      ];
    // Note: the empty deps array [] means
    // this useEffect will run once
    // similar to componentDidMount()
    useEffect(() => {
      fetch("http://javareesbyapi-env.eba-rtdeyeqd.ap-southeast-2.elasticbeanstalk.com/api/v1/getallclients/tenant/reesby")
        .then(res => res.json())
        .then(
          (result) => {
            setIsLoaded(true);
            setItems(result);
          },
          // Note: it's important to handle errors here
          // instead of a catch() block so that we don't swallow
          // exceptions from actual bugs in components.
          (error) => {
            setIsLoaded(true);
            setError(error);
          }
        )
    }, [])

    const classes = useStyles();
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      const rows = [];

      // map to push to rows, and display accordingly
      {items.map((item) => (                
        rows.push(            
            { id: item.clientId, clientName: item.clientName, clientEmail: item.clientEmail, clientWorkPhone: item.clientWorkPhone, clientIndustry: item.clientIndustry, clientPocName: item.clientPocName, clientWebsite: item.clientWebsite },     
        )
      ))};

      return (
        <React.Fragment>
          <CssBaseline />
